INSERT INTO `ratings` VALUES ('010e6368-ab65-4be4-b677-0b484b86fb30','dd30423e-66bb-4e56-8965-db82e378e39e',5,'Near it in the field, I remember, were three faint points of light, three telescopic stars infinitely remote, and all around it was the unfathomable darkness of empty space.','2020-10-31 03:26:11'),('018a227a-aa93-4a8d-8629-1405109451d2','13590657-82af-497c-bfb9-c8a40f97cd4d',1,'She stared at him in astonishment, and as she read something of the significant hieroglyphic of his battered face, her lips whitened.','2020-10-31 03:26:10'),('01c44493-1960-4e09-8b6a-1e244f38e707','2675e3f6-22db-4253-8d5c-eb7d8cfa333c',3,'It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.','2020-10-31 03:26:09'),('0202e266-82b5-4b7d-a94b-af54a028831b','8410caee-7d9d-42e3-8a2e-1d26d2cd71da',3,'Then followed a battle of looks between them, but the captain soon knuckled under, put up his weapon, and resumed his seat, grumbling like a beaten dog.','2020-10-31 03:26:11'),('0215b1ca-a658-47d2-a35a-77412227dea6','20eedda7-daca-4afd-ab2a-4e6196d63659',2,'And with that he went off to see my father, taking me with him by the arm.','2020-10-31 03:26:12'),('02e9d244-3a9c-4499-9e08-1802281cf0ed','7495acac-ab52-4c6c-a90d-a23bd278f937',3,'It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.','2020-10-31 03:26:09'),('031e4fb9-7e39-4935-9881-4bf4f23d3e03','ac296699-2563-4d92-ae3e-7f0aa36e5ae1',1,'It is a truth universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife.','2020-10-31 03:26:09'),('03da8062-00f7-4a95-84bc-b24e88b4b89d','e1762525-eaa6-4d57-979a-c7fed3a4b34f',2,'Near it in the field, I remember, were three faint points of light, three telescopic stars infinitely remote, and all around it was the unfathomable darkness of empty space.','2020-10-31 03:26:08'),('03f9fb6f-3285-4dc5-a1ed-83221f8e9a06','ba315650-138b-4171